import React, { useState, useEffect } from "react";
import GolfDataService from "../../services/golf";
import "./nextTournament.css";
import Button from "react-bootstrap/Card";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";

function NextTournament() {
  const [nextTournament, setTournament] = useState({});

  useEffect(() => {
    getTournament();
  }, []);

  const getTournament = () => {
    GolfDataService.getNextTournament()
      .then((response) => {
        setTournament(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  return (
    <div className="componentContainer">
      <Container fluid>
        <Row>
          <Col>
            <Container className="tournamentCard">
              <Card style={{ width: "18rem" }}>
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>Next PGA Event</Card.Title>
                  <Card.Text>{nextTournament.Name}</Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>
            </Container>
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="algoPickCard">
              <Card style={{ width: "18rem" }}>
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>AlgoPick</Card.Title>
                  <Card.Text>{nextTournament.Name}</Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>
            </Container>
          </Col>
        </Row>
        <Row>
          <Col>
          <Container className="honorableMentionsCard">
              <Card style={{ width: "18rem" }}>
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>Honorable Mentions</Card.Title>
                  <Card.Text>{nextTournament.Name}</Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>
            </Container>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default NextTournament;
